It is possible to write programs that handle exceptions. The previous line of code can be handled like this: result := unsafe (10 / 0)
match error?(result) { true -> println!("Math still works!"), false -> println!("Math is broken :("),
} An exception is just an object that has two properties: error_type and error_message. For example: { error_type: :zero_division, error_message: "division by zero"
}

